import React from 'react';
import { Element } from 'react-scroll';

function Resume() {
	return (
		<div
			className="d-flex flex-column justify-content-center align-items-center mt-4 mb-4"
			style={{ background: 'black', height: '300px', padding: '8em 0' }}
		>
			<Element name="resume">
				<p style={{ color: 'white', fontSize: '2em' }}>به استخدام من تمایل دارید ؟</p>
			</Element>
			<button
				style={{
					background: 'black',
					color: 'white',
					padding: '.4em 1.3em',
					border: '2px solid white',
					outline: 'none',
					fontSize: '1.5em'
				}}
			>
				دانلود رزومه
			</button>
		</div>
	);
}

export default Resume;
